Here's a basic implementation of a CSV (Comma Separated Values) parser in Rust:
```rust
use std::fs::File;
use std::io::{BufRead, BufReader};
use std::error::Error;

// Define a structure to hold each row of the CSV file
#[derive(Debug)]
struct Row {
    values: Vec<String>,
}

impl Row {
    fn new(values: Vec<String>) -> Self {
        Self { values }
    }
}

fn parse_csv(file_path: &str) -> Result<Vec<Row>, Box<dyn Error>> {
    let file = File::open(file_path)?;
    let reader = BufReader::new(file);

    let mut rows = Vec::new();
    for line in reader.lines() {
        let line = line?;
        let values: Vec<String> = line.split(",").map(|value| value.to_owned()).collect();
        rows.push(Row::new(values));
    }

    Ok(rows)
}

fn main() {
    let file_path = "example.csv";
    match parse_csv(file_path) {
        Ok(rows) => {
            for row in rows {
                println!("{:?}", row);
            }
        },
        Err(error) => {
            println!("An error occurred while parsing the CSV file: {}", error);
        },
    }
}
```
This implementation reads the contents of a CSV file, line by line, and splits each line on the comma `,` character. The resulting values are stored in a `Row` struct, which contains a `Vec` of `String`s. The rows are then collected into a `Vec` of `Row`s, which is returned as the result of the `parse_csv` function. If any errors occur during the parsing process, a `Box<dyn Error>` is returned to indicate the failure.

